import { StatusBar } from 'expo-status-bar';

import { StyleSheet, Text, View, Image, TouchableHighlight } from 'react-native';
import { Header } from 'react-native/Libraries/NewAppScreen';
export default function Navbar() {
    
    return (
        
        <View style={styles.navbarOuterGroup}>
            <TouchableHighlight>
                <Image
                style={styles.logo}
                source={require('../assets/ypmath-logo.png')}
                />
            </TouchableHighlight>
            <View style={styles.navbarInnerTextGroup}>        
                <View style={styles.navbarInnerInnerTextGroup}>
                    <Text>Online Tuitions</Text>
                </View>    
                <View style={styles.navbarInnerInnerTextGroup}>
                    <Text>Log in</Text>
                </View>
            </View>
        </View>
    
    )
}

const styles = StyleSheet.create({
    logo:{
        flex: 1,
        width: 80,
        height: 75,
        resizeMode: 'contain'
    },
    navbarInnerTextGroup:{
        color: 'black',
        flexDirection:'row',
        justifyContent:'flex-end',
        flex:1
    },
    navbarInnerInnerTextGroup:{
        marginHorizontal:10,
        
        flexDirection:'row',
        alignContent:'center',
        alignItems:'center',
        justifyContent:'center'
        // alignItems:'baseline'
    },
    navbarOuterGroup: {
        backgroundColor:"#F3F3F3",
        position:'absolute',
        marginTop:25,
        width: 'auto',
        minWidth: '100%',
        flexDirection: 'row',
    }    
})
